// The root component that brings together the app’s components and routing. It serves as the main structure of the app.

import React from 'react';
import logo from './assets/images/logo.png';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} alt="Logo" style={{ height: '100px' }} />
        <p>Logo should appear above.</p>
      </header>
    </div>
  );
}

export default App;
